			</image>
		</view>
		<!-- 中间tabs部分 -->
		<view class="center-item-box">
			<view class="center-item-warp">
				<view class="item" v-for="(item,index) in tabsArrData" :key="index" @click="changeTabsFun(index)">
					<!-- <view class="item-img" v-show="tabsindex == index ? true:false"> -->
					<view class="item-img">
						<image :src="item.img" mode=""></image>
					</view>
					<!-- <view class="item-img" v-show="tabsindex == index ? false:true">
						<image :src="item.img_no" mode=""></image>
					</view> -->
					<view :class="tabsindex == index ? 'item-title-active' : 'item-title' ">
						<text>{{item.title}}</text>
