		</view> -->
		<!-- 协议公告弹窗 -->
		<u-popup :show="popupShow" mode="center" bgColor="transparent" @close="popupShow = false">
			<view class="myPopup flex-col">
				<view class="bg">
					<view class="title">{{dealData.jm_title}}</view>
					<view class="time">{{dealData.sm_create_time}}</view>
					<scroll-view scroll-y="true" class="scroll-Y">
						<view class="info">
							<rich-text :nodes="dealData.jm_content"></rich-text>
						</view>
					</scroll-view>
					<view class="confirm" @click="confirmFun">确认接受</view>
				</view>
				<image class="close" src="https://tm.ydlweb.com/icons/popup-close.png" @click="popupShow = false"></image>
