<script>
	import {
		GetAgreement // 加盟合作协议 接口
	} from '@/api/index.js'
	let that, app = getApp()
	export default {
		data() {
			return {
				tabsArrData: [ // tabs数据
					{
						id: 0,
						title: '供应链合作',
						// img: '../../static/icons/cooperation-icon1.png',
						img: 'https://xcx.gdqhwy.com/public/upload/goods/2022/07-21/ce40cf139707db9034361d01d2e858a4.png',
						// img_no: '../../static/icons/cooperation-icon1-no.png'
					}, {
						id: 1,
						title: '加盟合作',
						img: 'https://xcx.gdqhwy.com/public/upload/goods/2022/07-21/dd730a9ef57c895f8f93ef176ad64abc.png',
						// img: '../../static/icons/cooperation-icon2.png',
						// img_no: '../../static/icons/cooperation-icon2-no.png'
					}, {
						id: 2,
						title: '自由人安装合作',
						img: 'https://xcx.gdqhwy.com/public/upload/goods/2022/07-21/6665ae8b9eab7c0a1ddcd225f4f86e4b.png',

						// img: '../../static/icons/cooperation-icon3.png',
						// img_no: '../../static/icons/cooperation-icon3-no.png'
					}, {
						id: 3,
						title: '我是合伙人',
						img: 'https://xcx.gdqhwy.com/public/upload/goods/2022/07-21/e4194156ed4ed669af10b289bb6928a1.png',
						// img: '../../static/icons/cooperation-icon4.png',
						// img_no: '../../static/icons/cooperation-icon4-no.png'
					}
				],
				tabsindex: 0, // 当前tabs标识
				popupShow: false, // 合作协议弹窗标识
				agreementData: [], // 协议数组数据
				dealData: {}, // 选择的合作类型的协议数据
			}
		},
		onShow() {
			this.GetAgreementFun()
		},
		methods: {
			// 获取加盟合作协议数据
			GetAgreementFun() {
				GetAgreement({}, (res) => {
					if (res.status == 1) {
						this.agreementData = res.result
					} else {
						uni.showToast({
							title: res.msg,
							icon: 'none'
						})
					}
				})
			},
			// 切换当前tabs
			changeTabsFun(idx) {
				this.tabsindex = idx
				if (this.agreementData[this.tabsindex].jm_is_show == 0) {
					this.dealData = {}
					this.dealData = this.agreementData[this.tabsindex]
					this.popupShow = true
				}
			},
			// 确认协议
			confirmFun() {
				this.popupShow = false
				this.clickJumpFun('/pages/applyJoin/applyJoin', this.tabsindex)
			},
			// 路由跳转
			clickJumpFun(e, typeindex) {
				uni.navigateTo({
					url: e + '?type_id=' + typeindex
				})
			},
		}
	}
</script>

